import React, { useEffect, useState } from "react";
import {
  View,
  Text,
  StyleSheet,
  Image,
  Dimensions,
  TouchableOpacity,
} from "react-native";
import axios from "axios";
import baseUrlGenerator from "../../generator/baseUrlGenerator";
import Toast from "react-native-toast-message";
import { KeyboardAwareScrollView } from "react-native-keyboard-aware-scroll-view";
import FormContainer from "../welcomeHeader/ReusableForms/FormContainer";
import FormInput from "../welcomeHeader/ReusableForms/FormInput";
import FormError from "../welcomeHeader/ReusableForms/FormError";

var { width } = Dimensions.get("window").width / 1.2;

const Login = (props) => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phoneNumber, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  //User Authentication
  const submitRegister = () => {
    if (name === "" || email === "" || phoneNumber === "" || password === "") {
      setError("Please fill all fields");
    }

    let userDetails = {
      name: name,
      email: email,
      phoneNumber: phoneNumber,
      password: password,
      isAdmin: false,
    };

    // axios
    //   .post(`${baseUrlGenerator}onlineUser/register`, userDetails)
    //   .then((res) => {
    //     console.log("RESPONSE", res);
    //     if (res.status == 200) {
    //       Toast.show({
    //         type: "success",
    //         position: "top",
    //         text1: "Registration Successful",
    //         text2: "Please Login",
    //         visibilityTime: 3000,
    //         topOffset: 50,
    //       });
    //       setTimeout(() => {
    //         props.navigation.navigate("Login");
    //       }, 500);
    //     }
    //   })
    // .catch((err) => {
    //   console.log("ERROR ERROR", err);
    //   Toast.show({
    //     type: "error",
    //     position: "top",
    //     text1: "Registration Failed",
    //     text2: "Please Try Again",
    //     visibilityTime: 3000,
    //     autoHide: true,
    //     topOffset: 50,
    //   });
    // });

    fetch(`${baseUrlGenerator}onlineUser/register`, {
      method: "PUT",
      headers: {
        Accept: "application/json, text/plain, */*",
        "Content-Type": "application/json",
      },
      body: JSON.stringify(userDetails),
    })
      .then((res) => res.text())
      .then((res) => {
        console.log("RESPONSE", res);
        if (res.status == 200) {
          Toast.show({
            type: "success",
            position: "top",
            text1: "Registration Successful",
            text2: "Please Login",
            visibilityTime: 3000,
            topOffset: 50,
          });
          setTimeout(() => {
            props.navigation.navigate("Login");
          }, 500);
        }
      })
      .catch((err) => {
        console.log("ERROR ERROR", err);
        Toast.show({
          type: "error",
          position: "top",
          text1: "Registration Failed",
          text2: "Please Try Again",
          visibilityTime: 3000,
          autoHide: true,
          topOffset: 50,
        });
      });
  };

  return (
    <View style={styles.Container}>
      <View style={{ flexDirection: "row" }}>
        <Image
          source={{
            uri: "https://www.graphicsprings.com/filestorage/stencils/3055581cff0526602142cbb0bfba9fca.png?width=500&height=500",
          }}
          style={styles.logo}
        />
        <Text style={styles.title}>GRIFFITH-STORE</Text>
      </View>

      <KeyboardAwareScrollView
        viewIsInsideTabBar={true}
        extraHeight={200}
        enableOnAndroid={true}
      >
        <FormContainer title={"User Registration"} style={{ marginTop: 20 }}>
          <FormInput
            placeholder="Enter your name"
            value={name}
            onChangeText={(text) => setName(text.toLowerCase())}
            id={"name"}
            name={"name"}
          />

          <FormInput
            placeholder="Enter your E-mail"
            value={email}
            onChangeText={(text) => setEmail(text.toLowerCase())}
            id={"email"}
            name={"email"}
          />

          <FormInput
            placeholder="Enter your Phone number"
            value={phoneNumber}
            onChangeText={(text) => setPhone(text)}
            id={"phoneNumber"}
            keyboardType={"number-pad"}
            name={"phoneNumber"}
          />

          <FormInput
            placeholder="Enter your Password"
            value={password}
            onChangeText={(text) => setPassword(text)}
            id={"password"}
            secureTextEntry={true}
            name={"password"}
          />

          <View style={{ flexDirection: "row", marginLeft: 75 }}>
            <Text>If account exist: </Text>
            <TouchableOpacity
              onPress={() => props.navigation.navigate("Login")}
            >
              <View>
                <Text style={{ fontWeight: "bold", fontSize: 15 }}>Login</Text>
              </View>
            </TouchableOpacity>
          </View>
          {error ? <FormError error={error} /> : null}
          <TouchableOpacity onPress={() => submitRegister()}>
            <View style={styles.registerBtn}>
              <Text style={styles.logText}>REGISTER</Text>
            </View>
          </TouchableOpacity>
        </FormContainer>
      </KeyboardAwareScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  Container: {
    flex: 1,
    backgroundColor: "#fff",
    width: 360,
    height: "70%",
    marginTop: 50,
    marginLeft: 17,
    borderRadius: 20,
    marginBottom: 50,
  },

  title: {
    fontSize: 26,
    fontWeight: "bold",
    marginTop: 90,
    marginLeft: -10,
  },

  logo: {
    width: 100,
    height: 100,
    marginLeft: 10,
    marginTop: 50,
  },

  registerBtn: {
    marginTop: 10,
    width: 200,
    height: 50,
    alignSelf: "center",
    backgroundColor: "#1662A2",
    borderRadius: 20,
    marginBottom: 20,
  },

  logText: {
    color: "#fff",
    fontSize: 20,
    fontWeight: "bold",
    textAlign: "center",
    paddingTop: 10,
  },
});

export default Login;
